import React, { useState } from 'react';
import axios from 'axios';
import https from 'https';

const Register = () => {
  const [formData, setFormData] = useState({
    name: '',
    idNumber: '',
    password: '',
    confirmPassword: '',
    username: '',
    accountNumber: '',
  });
  const [errors, setErrors] = useState({});
  const [isLoading, setIsLoading] = useState(false);
  const [submitStatus, setSubmitStatus] = useState({ type: '', message: '' });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
    if (errors[name]) {
      setErrors(prev => ({
        ...prev,
        [name]: ''
      }));
    }
  };

  const validateForm = () => {
    const newErrors = {};
    if (!formData.name.trim()) newErrors.name = 'Name is required';
    if (!formData.idNumber.trim()) newErrors.idNumber = 'ID Number is required';
    if (!formData.username.trim()) newErrors.username = 'Username is required';
    if (!formData.accountNumber.trim()) newErrors.accountNumber = 'Account number is required';
    if (formData.password.length < 6) newErrors.password = 'Password must be at least 6 characters';
    if (formData.password !== formData.confirmPassword) newErrors.confirmPassword = 'Passwords do not match';

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!validateForm()) return;

    setIsLoading(true);
    setSubmitStatus({ type: '', message: '' });

    try {
      const axiosInstance = axios.create({
        baseURL: 'https://localhost:5000',
        httpsAgent: new https.Agent({  
          rejectUnauthorized: false
        })
      });

      const response = await axiosInstance.post('/api/user/register', formData);

      if (response.status === 201) {
        setSubmitStatus({
          type: 'success',
          message: 'Registration successful!'
        });
      }
    } catch (error) {
      console.error('Registration error:', error);
      console.error('Response details:', error.response);

      setSubmitStatus({
        type: 'error',
        message: error.response?.data?.details || 'Error registering user. Please try again.',
      });
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Name:</label>
        <input type="text" name="name" value={formData.name} onChange={handleChange} />
        {errors.name && <span className="error">{errors.name}</span>}
      </div>

      <div>
        <label>ID Number:</label>
        <input type="text" name="idNumber" value={formData.idNumber} onChange={handleChange} />
        {errors.idNumber && <span className="error">{errors.idNumber}</span>}
      </div>

      <div>
        <label>Username:</label>
        <input type="text" name="username" value={formData.username} onChange={handleChange} />
        {errors.username && <span className="error">{errors.username}</span>}
      </div>

      <div>
        <label>Account Number:</label>
        <input type="text" name="accountNumber" value={formData.accountNumber} onChange={handleChange} />
        {errors.accountNumber && <span className="error">{errors.accountNumber}</span>}
      </div>

      <div>
        <label>Password:</label>
        <input type="password" name="password" value={formData.password} onChange={handleChange} />
        {errors.password && <span className="error">{errors.password}</span>}
      </div>

      <div>
        <label>Confirm Password:</label>
        <input type="password" name="confirmPassword" value={formData.confirmPassword} onChange={handleChange} />
        {errors.confirmPassword && <span className="error">{errors.confirmPassword}</span>}
      </div>

      <button type="submit" disabled={isLoading}>{isLoading ? 'Registering...' : 'Register'}</button>
      
      {submitStatus.message && (
        <p className={submitStatus.type === 'error' ? 'error' : 'success'}>
          {submitStatus.message}
        </p>
      )}
    </form>
  );
};

export default Register;
